window.bookSummaryJSON = "<p><b>Finally reunited with her family, Caly struggles to adjust to her new life and the decisions she made to get there.</b></p> <p>After giving up everything for them, she eagerly awaits the ceremony to receive the second half of her heart and become whole, even though it comes at an unsettling cost. She must marry Prince Aurelius and solidify her place within the Seelie Court.</p> <p>As she prepares for the event, Caly finds herself haunted by the memory of Malum Mendax, the Unseelie Princeâ€”feeling his eyes are on her when she's alone, shadowy silhouettes in her room, and even touching him in her dreams.</p> <p>What Caly doesn't know is that it's more than just his memory that haunts her. Malum Mendax has returned to punish his pet and those who took her away from him.</p>"; 
